import React from 'react';
import { DeleteForever } from '@material-ui/icons';


const TodoList = (props) => {
    const delItem = (id) =>{
        console.log("Delete");
        setItems((oldItems) => {
            return oldItems.filter((arrElem, index) => {
                return index !==id;
            });
        }); 

    };
    return(
    <>
     <li className="list-unstyled fw-bold shadow w-75 m-1 list"><span className="btn del" onClick={delItem}><DeleteForever /> </span> {props.itemv} </li>;
    </>
    )};

export default TodoList;
